                <th>Prix</th>
                <th>Qte</th>
                <th>Total</th>
                <th>actions</th>
            </tr>
        </thead>
        <tbody>
        {% for panier in paniers %}
            <tr>
                <td>{{ panier.id }}</td>
                <td>{{ panier.nom }}</td>
                <td>{{ panier.prix }}</td>
                <td>{{ panier.qte }}</td>
                <td>{{ panier.total }}</td>
                <td>
                    <a href=\"{{ path('panier_show', {'id': panier.id}) }}\">show</a>
                    <a href=\"{{ path('panier_edit', {'id': panier.id}) }}\">edit</a>
